import React from "react";
import './css/searchButton.css'

const SearchFilterForDoctors = (props) => {
  const { searchFilterEntry, 
    handleSubmitUserInput, 
    onChangeUserInput,
    handlePressEnterUserInput  } = props
  return (
    <div className="container mt-2">
      <div className="input-group mx-auto ">
        <input type="text" 
          className="form-control" 
          placeholder="Search for ..." 
          onChange = {onChangeUserInput}
          value = {searchFilterEntry}
          onKeyPress = {handlePressEnterUserInput} />
            <span className="input-group-btn">
              <button className="btn btn-search" type="button" onClick={handleSubmitUserInput} > Search</button>
            </span>
      </div>
    </div>
  );
}

export default SearchFilterForDoctors  ;
